import React from 'react';
import './intro.css';
import Github from 'src/img/github.png';
import linkedIn from 'src/img/linkedin.png';
import Instagram from '/img/instagram.png';

const Intro = () => {
  return (
    <div className="intro">
       <div className="i-left">
  <div className="i-name">
    <span>Hy ! I'm</span><span>Nabahat Imane</span>
    <span>Frontend developer with a passion for creating visually appealing and user-friendly web experiences. With a solid grasp of HTML, CSS, and JavaScript, I specialize in turning design concepts into interactive and responsive websites.</span>
    </div>
        <button className="button i-button">Hire me</button>
        </div>
        <div className="i-icons">
        <img src={Github} alt="" />
          <img src={Instagram} alt="" />
          <img src={linkedIn} alt="" />

        </div>
        <div className="i-right"></div>
    </div>
  );
};

export default Intro;
